import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root',
})
export class LabSeqService {
  private baseUrl = 'http://localhost:8080/labseq';

  constructor(private http: HttpClient) {}

  async getLabSeqValue(n: number): Promise<number> {
    try {
      const result = await this.http.get<number>(`${this.baseUrl}/${n}`).toPromise();

      if (result !== undefined) {
        return result;
      } else {
        throw new Error('Value is undefined');
      }
    } catch (error) {
      // Handle errors as needed
      console.error('Error fetching lab sequence value:', error);
      throw error;
    }
  }
}
